import React,{useState} from 'react';
import DatePicker from 'react-date-picker'

const Form = () => {
    const [firstname, setFirstname] = useState("");
    const [lastname, setLastname] = useState("");
    const [email, setEmail] = useState("");
    const [mobile, setMobile] = useState("");
    const [dob, setDob] = useState(new Date());
    const [course,setCourse]=useState("Maths");
    const [feedback,setFeedback]=useState("");
    const [gender,setGender]=useState("");
    const [agree,setAgree]=useState(false)
    
    const handleChangecourse =(e)=>{
        setCourse(e.target.value)

    }
    const handleChangetext =(e)=>{
        setFeedback(e.target.value)

    }
    const handleFirstName=(e)=>{
        setFirstname(e.target.value)

    }
    const handleLastName=(e)=>{
        setLastname(e.target.value)

    }
    function display(){
        return(
            <div>
        Your details:
        <div>{firstname+" "+lastname}</div>
        <div>{email}</div>
        <div>{mobile}</div>
        <div>{dob}</div>
        <div>{gender}</div>
        <div>{course}</div>
        <div>{agree}</div>
        
        


      </div>
        );
    }
    return (
        <div className="form">
          <div className="form-body">
              <div className="username">
                  <label className="form__label" >First Name </label>
                  <input className="form__input" type="text" onChange={handleFirstName} placeholder="First Name"/>
              </div>
              <div className="lastname">
                  <label className="form__label" >Last Name </label>
                  <input  type="text" name="" onChange={handleLastName}  className="form__input"placeholder="LastName"/>
              </div>
              <div className="email">
                  <label className="form__label" >Email </label>
                  <input  type="email" onChange={(e)=>setEmail(e.target.value)} className="form__input" placeholder="Email"/>
              </div>
              <div className="mobile">
                  <label className="form__label" >Mobile Number </label>
                  <input className="form__input" type="text"  onChange={(e)=>setMobile(e.target.value)} placeholder="Mobile NUmber"/>
              </div>
              <div className="date">
              <label className="form__label" >Date of Birth</label>
                <DatePicker onChange={setDob} value={dob} />
              </div>
              <div className='gender' >
              Select your gender: 
             <div className="gen-sel">
                <input type="radio" id="gen-male" name="gen-ans" onChange={(e)=>setGender(e.target.value)} value="Male" />Male
                <input type="radio" id="gen-female" name="gen-ans" onChange={(e)=>setGender(e.target.value)} value="Female" />Female
            </div>
            <label>
                Select course: 
                <select value={course} onChange={handleChangecourse}>
                <option value="Maths">Maths</option>
                <option value="Physics">Physics</option>
                <option value="Chemistry">Chemistry</option>
                <option value="Computer Science">Computer Science</option>
                </select>
            </label>
            <div>
            Enter your suggestions:
            <textarea value={feedback} onChange={handleChangetext} />
            </div>
            <div className='terms'>
              I acknowledge all the informations given above are correct 
             <div className="ack">
                <input type="checkbox" id="terms" checked={agree}
          onChange={setAgree(!agree)} name="terms-ans" value="Agree" />Agree
            </div>
            </div>
          </div>
          <div className="footer">
              <button type="submit" className="btn" onSubmit={display}>Submit Details</button>
          </div>
      </div>   
      
      </div> 
      
    );
}



export default Form;
